import React, { useState } from 'react';
import "./Navigation.scss";

export default function Navigation() {
  return (
    <div>
      <div className="navigation-anchor">
        <div className="navigation-bg" />
      </div>
      <div className="navigation-container">
        <ul>
          <li>Home</li>
          <li>Articles</li>
          <li>Portfolio</li>
          <li>Pricing</li>
          <li>Contact</li>
        </ul>
      </div>
    </div>
  )
}
